ntellectual property. This is far from the norm, in our industry or at most entertainment content- producing companies. We didn’t always own it all. But thanks to some legal wrangling with our first publisher after Half-Life shipped, we now do. This has freed us to make our own decisions about our products.\r\n\r\nValve is more than a game company. We started our existence as a pretty traditional game company. And we’re still one, but with a hugely expanded focus. Which is great, because we get to make better games as a result,\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:767:\"<p>Valve is self-funded. We haven’t ever brought in outside financing. Since our earliest days this has been incredibly important in providing freedom to shape the company and its business practices.</p>\n<p>Valve owns its intellectual property. This is far from the norm, in our industry or at most entertainment content- producing companies. We didn’t always own it all. But thanks to some legal wrangling with our first publisher after Half-Life shipped, we now do. This has freed us to make our own decisions about our products.</p>\n<p>Valve is more than a game company. We started our existence as a pretty traditional game company. And we’re still one, but with a hugely expanded focus. Which is great, because we get to make better games as a result,</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:10:\"field_tags\";a:0:{}s:11:\"field_image\";a:0:{}}',0,1349022451,1),('field:node:11','a:3:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:34:\"The Drupal Saint-Louis User Group.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:42:\"<p>The Drupal Saint-Louis User Group.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:20:\"field_resident_image\";a:0:{}s:22:\"field_type_of_resident\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:3:\"tid\";s:1:\"3\";}}}}',0,1349022821,1),('field:node:12','a:3:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;