operated by <a href=\"http://bantalabs.com/\">Bantalabs</a> will be spun off into <strong>NDAR NUMERIQUE</strong>, an open space for technologists, designers and entrepreneurs to come together.</p>\n<p>Ndar Numérique will be a separate legal entity, governed by a board of directors and and an advisory board, while Bantalabs as an  open source development company, remains one of the residents of the rebranded coworking space.</p>\n<p>We\'re confident the space is now strong enough to define its own path and become a major influence in the Saint-Louis tech scene. For Bantalabs, spinning off Ndar Numérique frees up resources as the team grows both within Senegal and across West-Africa.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:10:\"field_tags\";a:0:{}s:11:\"field_image\";a:0:{}}',0,1349022451,1),('field:node:8','a:3:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:751:\"Valve is self-funded. We haven’t ever brought in outside financing. Since our earliest days this has been incredibly important in providing freedom to shape the company and its business practices.\r\n\r\nValve owns its intellectual property. This is far from the norm, in our industry or at most entertainment content- producing companies. We didn’t always own it all. But thanks to some legal wrangling with our first publisher after Half-Life shipped, we now do. This has freed us to make our own decisions about our products.\r\n\r\nValve is more than a game company. We started our existence as a pretty traditional game company. And we’re still one, but with a hugely expanded focus. Which is great, because we get to make better games as a result,\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:767:\"<p>Valve is self-funded. We haven’t ever brought in outside financing. Since our earliest days this has been incredibly important in providing freedom to shape the company and its business practices.</p>\n<p>Valve owns its intellectual property. This is far f