INSERT INTO `field_data_body` VALUES ('node','event',0,1,1,'und',0,'monthly drupal user meetup right here in Saint-Louis.','','filtered_html'),('node','event',0,2,2,'und',0,'this is the description of the global drupal training day.','','filtered_html'),('node','resident',0,3,3,'und',0,'An NGO in the health/education sector, working exclusively on remedial and IT-related projects with young girls.','','filtered_html'),('node','resident',0,4,4,'und',0,'An open source web development agency.','','filtered_html'),('node','page',0,5,5,'und',0,'this is the general about page','','filtered_html'),('node','event',0,6,6,'und',0,'This complete developer toolset for creating Mac, iPhone, and iPad apps includes the Xcode IDE, performance analysis tools, iOS Simulator, and the latest Mac OS X and iOS SDKs.\r\n\r\nI need to make a app for iPhone with features:\r\n\r\nUse camera capture a image.\r\nRecognize that image: Do it match with a sample image or not?\r\nPlease help me to find out the solution.\r\n\r\nDo we have any online API to do that (from Google, Yahoo, ...)? For example, I upload an image and I get an image\'Id, after that I request a url to compare an new image with an exist one. Can I do that, my Pro?\r\n\r\nThanks in advance!','','filtered_html'),('node','article',0,7,7,'und',0,'As of November 2012 the coworking facilities operated by <a href=\"http://bantalabs.com/\">Bantalabs</a> will be spun off into <strong>NDAR NUMERIQUE</strong>, an open space for technologists, designers and entrepreneurs to come together.\r\n\r\nNdar Numérique will be a separate legal entity, governed by a board of directors and and an advisory board, while Bantalabs as an  open source development company, remains one of the residents of the rebranded coworking space.\r\n\r\nWe\'re confident the space is now strong enough to define its own path and become a major influence in the Saint-Louis tech scene. For Bantalabs, spinning off Ndar Numérique frees up resources as the team grows both within Senegal and across West-Africa. ','','filtered_html'),('node','article',0,8,8,'und',0,'Valve is self-funded. We haven’t ever brought in outside financing. Since our earliest days this has been incredibly important in providing freedom to shape the company and its business practices.\r\n\r\nValve owns its intellectual property. This is far from the norm, in our industry or at most entertainment content- producing companies. We didn’t always own it all. But thanks to some legal wrangling with our first publisher after Half-Life shipped, we now do. This has freed us to make our own decisions about our products.\r\n\r\nValve is more than a game company. We started our existence as a pretty traditional game company. And we’re still one, but with a hugely expanded focus. Which is great, because we get to make better games as a result,','','filtered_html'),('node','article',0,9,9,'und',0,'Valve is self-funded. We haven’t ever brought in outside financing. Since our earliest days this has been incredibly important in providing freedom to shape the company and its business practices.\r\n\r\nValve owns its intellectual property. This is far from the norm, in our industry or at most entertainment content- producing companies. We didn’t always own it all. But thanks to some legal wrangling with our first publisher after Half-Life shipped, we now do. This has freed us to make our own decisions about our products.\r\n\r\nValve is more than a game company. We started our existence as a pretty traditional game company. And we’re still one, but with a hugely expanded focus. Which is great, because we get to make better games as a result,','','filtered_html'),('node','article',0,10,10,'und',0,'Valve is self-funded. We haven’t ever brought in outside financing. Since our earliest days this has been incredibly important in providing freedom to shape the company and its business practices.\r\n\r\nValve owns its intellectual property. This is far from the norm, in our industry or at most entertainment content- producing companies. We didn’t always own it all. But thanks to some legal wrangling with our first publisher after Half-Life shipped, we now do. This has freed us to make our own decisions about our products.\r\n\r\nValve is more than a game company. We started our existence as a pretty traditional game company. And we’re still one, but with a hugely expanded focus. Which is great, because we get to make better games as a result,','','filtered_html'),('node','resident',0,11,11,'und',0,'The Drupal Saint-Louis User Group.','','filtered_html'),('node','resident',0,12,12,'und',0,'Google Technology User Group Saint-Louis.','','filtered_html');
