INSERT INTO `search_dataset` VALUES (1,'node',' saintlouis drupal meetup 3 monthly drupal user meetup right here in saintlouis friday september 14 2012 1930 to 2100 saintlouis senegal ndar numérique rue ndn 11 ndiolofènesor saintlouis senegal bantalabs  ',0),(2,'node',' global drupal training day this is the description of the global drupal training day friday september 14 2012 900 to 1700 saintlouis senegal ndar numérique bantalabs  ',0),(3,'node',' edulogos senegal an ngo in the health education sector working exclusively on remedial and itrelated projects with young girls nonprofit association ',0),(4,'node',' bantalabs an open source web development agency company ',0),(5,'node',' about ndar numérique this is the general about page  ',0),(6,'node',' startupweekend saintlouis this complete developer toolset for creating mac iphone and ipad apps includes the xcode ide performance analysis tools ios simulator and the latest mac os x and ios sdks i need to make a app for iphone with features use camera capture a image recognize that image do it match with a sample image or not please help me to find out the solution do we have any online api to do that from google yahoo for example i upload an image and i get an image id after that i request a url to compare an new image with an exist one can i do that my pro thanks in advance friday november 9 2012 900 to sunday november 11 2012 1700 saintlouis senegal rue ndn 11 à côté oillybia ndiolofènesor saintlouis bantalabs université gaston berger  ',0),(7,'node',' bantalabs coworking space reboots as ndar numérique as of november 2012 the coworking facilities operated by bantalabs will be spun off into ndar numerique  an open space for technologists designers and entrepreneurs to come together ndar numérique will be a separate legal entity governed by a board of directors and and an advisory board while bantalabs as an open source development company remains one of the residents of the rebranded coworking space we re confident the space is now strong enough to define its own path and become a major influence in the saintlouis tech scene for bantalabs spinning off ndar numérique frees up resources as the team grows both within senegal and across westafrica  ',0),(8,'node',' ndar numérique partners with 88mph nairobi valve is selffunded we haven t ever brought in outside financing since our earliest days this has been incredibly important in providing freedom to shape the company and its business practices valve owns its intellectual property this is far from the norm in our industry or at most entertainment content producing companies we didn t always own it all but thanks to some legal wrangling with our first publisher after halflife shipped we now do this has freed us to make our own decisions about our products valve is more than a game company we started our existence as a pretty traditional game company and we re still one but with a hugely expanded focus which is great because we get to make better games as a result  ',0),(9,'node',' maison de l entrepreneuriat announces workshops at ndar numérique valve is selffunded we haven t ever brought in outside financing since our earliest days this has been incredibly important in providing freedom to shape the company and its business practices valve owns its intellectual property this is far from the norm in our industry or at most entertainment content producing companies we didn t always own it all but thanks to some legal wrangling with our first publisher after halflife shipped we now do this has freed us to make our own decisions about our products valve is more than a game company we started our existence as a pretty traditional game company and we re still one but with a hugely expanded focus which is great because we get to make better games as a result  ',0),(10,'node',' partner space jokkolabs dakar celebrates 2nd birthday on octobber 10th valve is selffunded we haven t ever brought in outside financing since our earliest days this has been incredibly important in providing freedom to shape the company and its business practices valve owns its intellectual property this is far from the norm in our industry or at most entertainment content producing companies we didn t always own it all but thanks to some legal wrangling with our first publisher after halflife shipped we now do this has freed us to make our own decisions about our products valve is more than a game company we started our existence as a pretty traditional game company and we re still one but with a hugely expanded focus which is great because we get to make better games as a result  ',0),(11,'node',' drupal saintlouis the drupal saintlouis user group tech community ',0),(12,'node',' gtug saintlouis google technology user group saintlouis tech community ',0);
